import React from 'react';
import './Header.css';
import Navigation from './Navigation';
import Logo from './logo.png';

export default props => {
    return(
        <div>
            <Navigation />

            <div className="logo-right">
                <h1 id="name">lg</h1>
            </div>
        </div>
    )
}
